import history from "./history";

const dashboard = () => {
    const logOut = (event) => {
        event.preventDefault();
        //axios.delete('http://localhost:8080/api/logins/').then(r => );
    };

    return (
        <form onSubmit={logOut}>
            <p>Logged In</p>
            <input type="submit" value="Log Out" />
        </form>
    );
};

export default dashboard;
